#include <iostream>
#include <unordered_set>

	using namespace std;
    int lengthOfLongestSubstring(string s) {
    	// if(!s.length()) return 0;
        unordered_set<char> set;
        int res = 0;
        for(int begin = 0; begin < s.length() - res ; begin++) {
        	int i = begin;
	        while(i < s.length()) {
	            char c = s.at(i);
	            if(set.find(c) != set.end()) {
	            	//got end
	            	if(set.size() > res) {
	            		res = set.size();
	            	}
	            	set.clear();
	            	if(i == s.length() - 1)
	            		break;
	            	// if(s.at(i) == c) {
	            	while(i+1 < s.length() && c == s.at(i+1)) {
	            		i++;
	            	}
		            // }
	            } else {
	            	set.insert(c);
	            	i++;
	            }          
	        }
	        if(set.size() > res)
	        	res = set.size();
	        set.clear();
	    }
        return res;
    }
